import React from "react";

const styles= {
  fontWeight: 18,
  fontStyle: italic
}
export const Tile = ({tile}) => {
  return (
    <div className="tile-container">
    {
      Object.values(tile).map((tileElement, index) => {
        if(index === 0){
          return <p className="tile-title" style={styles}>{tileElement}</p>
        }else return <p className='tile'>{tileElement}</p>
      })
    }
    
    </div>
  );
};
